import React, { useState, useCallback, useEffect } from 'react';
import ReactFlow, { 
  useNodesState, 
  useEdgesState,
  Controls,
  Background
} from 'reactflow';
import 'reactflow/dist/style.css';
import styled from 'styled-components';
import { CustomNode } from './NodeInput';
import { motion } from 'framer-motion';

const WhiteboardContainer = styled.div`
  width: 100vw;
  height: 100vh;
  position: relative;
  overflow: hidden;
  background: ${props => props.theme.terminal.bg};
`;

const GridDot = styled(motion.circle)`
  fill: #0EF928;
`;

// Create a component for the animated grid
const AnimatedGrid = ({ cols, rows }) => {
  const spacing = 24; // Same as our previous grid spacing
  const dotSize = 2; // 1px radius for each dot

  // Calculate number of dots needed based on screen size
  const dotsArray = [];
  for (let y = 0; y < rows; y++) {
    for (let x = 0; x < cols; x++) {
      dotsArray.push({ x, y });
    }
  }

  // Calculate delay based on position (ripple effect)
  const getDelay = (x, y) => {
    // Distance from top-left corner determines delay
    const distance = Math.sqrt(x * x + y * y);
    return distance * 0.1; // 100ms per "step"
  };

  return (
    <svg
      style={{
        position: 'absolute',
        top: 0,
        left: 0,
        width: '100%',
        height: '100%',
        pointerEvents: 'none'
      }}
    >
      {dotsArray.map(({ x, y }) => (
        <GridDot
          key={`${x}-${y}`}
          cx={x * spacing}
          cy={y * spacing}
          r={1}
          initial={{ opacity: 0 }}
          animate={{ opacity: 0.2 }}
          transition={{
            duration: 0.6,
            delay: getDelay(x, y),
            ease: "easeOut",
            opacity: {
              times: [0, 0.5, 1],
              values: [0, 1, 0.2]
            }
          }}
        />
      ))}
    </svg>
  );
};

// Add a styled Background component
const AnimatedBackground = styled(Background)`
  && .react-flow__background-pattern circle {
    fill: ${props => props.theme.terminal.border};
    opacity: 0;
    animation: dotAppear 1.2s ease-out forwards;
    animation-delay: calc(
      (
        ${props => Math.floor(props.offset?.x / 24 || 0)} * 0.2s + 
        ${props => Math.floor(props.offset?.y / 24 || 0)} * 0.2s
      )
    );
  }

  @keyframes dotAppear {
    0% { opacity: 0; }
    40% { opacity: 1; }
    100% { opacity: 0.2; }
  }
`;

const nodeTypes = {
  custom: CustomNode
};

const Whiteboard = () => {
  const [nodes, setNodes, onNodesChange] = useNodesState([]);
  const [edges, setEdges, onEdgesChange] = useEdgesState([]);
  const [position, setPosition] = useState({ x: 0, y: 0 });
  const [gridDimensions, setGridDimensions] = useState({ cols: 0, rows: 0 });

  // Calculate grid dimensions on mount and resize
  useEffect(() => {
    const calculateDimensions = () => {
      const cols = Math.ceil(window.innerWidth / 24) + 1;
      const rows = Math.ceil(window.innerHeight / 24) + 1;
      setGridDimensions({ cols, rows });
    };

    calculateDimensions();
    window.addEventListener('resize', calculateDimensions);
    return () => window.removeEventListener('resize', calculateDimensions);
  }, []);

  const handleDoubleClick = useCallback((event) => {
    event.preventDefault();
    event.stopPropagation();

    const reactFlowBounds = event.currentTarget.getBoundingClientRect();
    const newPosition = {
      x: event.clientX - reactFlowBounds.left - position.x,
      y: event.clientY - reactFlowBounds.top - position.y,
    };

    const newNodeId = Date.now().toString();
    const newNode = {
      id: newNodeId,
      type: 'custom',
      position: newPosition,
      data: { 
        content: '',
        onRemove: () => {
          setNodes(nodes => nodes.filter(n => n.id !== newNodeId));
        }
      }
    };

    setNodes(nodes => [...nodes, newNode]);
  }, [position]);

  const onConnect = useCallback((params) => {
    setEdges(edges => [...edges, params]);
  }, []);

  return (
    <WhiteboardContainer>
      <AnimatedGrid cols={gridDimensions.cols} rows={gridDimensions.rows} />
      <ReactFlow
        nodes={nodes}
        edges={edges}
        onNodesChange={onNodesChange}
        onEdgesChange={onEdgesChange}
        onConnect={onConnect}
        nodeTypes={nodeTypes}
        onDoubleClick={handleDoubleClick}
        zoomOnDoubleClick={false}
        fitView={false}
        style={{ width: '100%', height: '100%' }}
        onNodeDragStart={(_, node) => {
          setNodes(nodes => 
            nodes.map(n => 
              n.id === node.id 
                ? { ...n, data: { ...n.data, isDragging: true }}
                : n
            )
          );
        }}
        onNodeDragStop={(_, node) => {
          setNodes(nodes => 
            nodes.map(n => 
              n.id === node.id 
                ? { ...n, data: { ...n.data, isDragging: false }}
                : n
            )
          );
        }}
        onMove={(_, viewState) => {
          setPosition({ x: viewState.x, y: viewState.y });
        }}
        panOnScroll={false}
        panOnDrag={true}
      >
        <AnimatedBackground
          gap={24}
          size={2}
          variant="dots"
          offset={{
            x: position.x,
            y: position.y
          }}
        />
        <Controls />
      </ReactFlow>
    </WhiteboardContainer>
  );
};

export default Whiteboard;
